-- ----------------------------
-- Table structure for `templi_admin`
-- ----------------------------
DROP TABLE IF EXISTS `templi_admin`;
CREATE TABLE `templi_admin` (
  `adminid` mediumint(9) unsigned NOT NULL auto_increment,
  `adminname` varchar(30) default NULL,
  `email` varchar(50) default NULL,
  `password` char(32) default NULL,
  `encrypt` char(6) default NULL COMMENT '随机字符串',
  `remark` varchar(50) default NULL COMMENT '备注',
  `role_id` smallint(6) default NULL COMMENT '角色id',
  `login_num` int(11) NOT NULL default '0',
  `last_logintime` int(11) default NULL,
  `last_loginip` varchar(30) default NULL COMMENT '登陆ip',
  PRIMARY KEY  (`adminid`),
  KEY `adminname` USING BTREE (`adminname`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 DELAY_KEY_WRITE=1;

