-- Table structure for `templi_attachment`
-- ----------------------------
DROP TABLE IF EXISTS `templi_attachment`;
CREATE TABLE `templi_attachment` (
  `aid` bigint(20) NOT NULL auto_increment,
  `userid` int(11) default NULL,
  `module` varchar(20) default NULL,
  `file_name` varchar(100) default NULL,
  `file_savename` varchar(100) default NULL,
  `file_path` varchar(255) default NULL,
  `file_type` varchar(30) default NULL,
  `file_size` int(11) default NULL,
  `file_ext` varchar(10) default NULL,
  `file_hash` char(32) default NULL,
  `status` tinyint(1) default '0' COMMENT '1使用0未使用',
  `is_admin` tinyint(1) default '0' COMMENT '1 管理员后台上传 0 前台用户上传',
  `upload_ip` char(15) default NULL,
  `upload_time` int(10) default NULL,
  PRIMARY KEY  (`aid`)
