  `title` varchar(30) NOT NULL default '' COMMENT '栏目名称',
  `category` varchar(30) NOT NULL default '' COMMENT '栏目标示 英文名',
  `st_name` varchar(30) NOT NULL default '' COMMENT '分类标示',
  `parent_id` varchar(30) NOT NULL default '0' COMMENT '父id',
  `keywords` varchar(255) NOT NULL default '' COMMENT '关键词',
  `description` varchar(255) NOT NULL default '',
  `display` tinyint(4) NOT NULL default '1' COMMENT '是否显示 0 不下时 1 显示',
  `listorder` mediumint(9) unsigned NOT NULL default '0' COMMENT '排序字段',
  PRIMARY KEY  (`id`),
