CREATE TABLE `templi_link` (
  `link_id` smallint(5) unsigned NOT NULL auto_increment COMMENT '友情链接id',
  `listorder` tinyint(3) NOT NULL default '0' COMMENT '排序',
  `title` varchar(15) NOT NULL default '' COMMENT '名称',
  `url` varchar(255) NOT NULL default '' COMMENT '链接',
  `description` varchar(255) NOT NULL default '' COMMENT '描述',
  `logo` varchar(100) NOT NULL default '' COMMENT 'logo',
  `islogo` tinyint(1) unsigned NOT NULL default '0' COMMENT '是否有logo',
  `status` tinyint(3) NOT NULL default '0' COMMENT '是否审核 0 未审核 99 审核通过 -1 审核未通过',
  `contact` varchar(100) NOT NULL default '' COMMENT '联系方式',
  PRIMARY KEY  (`link_id`),
  KEY `idx_ifcheck_vieworder` (`status`,`listorder`)
