  `id` mediumint(9) unsigned NOT NULL auto_increment,
  `title` varchar(30) NOT NULL default '' COMMENT '显示名称',
  `sign` varchar(32) NOT NULL default '' COMMENT '当前定位标识',
  `st_name` varchar(30) NOT NULL default '' COMMENT '类别',
