INSERT INTO `templi_news_data` VALUES ('4', '<h2 style=\"margin: 0px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); padding-bottom: 3px; font-size: 15px; color: rgb(255, 67, 20); font-family: tahoma, arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">2.6. 皮肤设计指南</h2><p style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">xhEditor的皮肤保存在xheditor_skin文件夹中，每个皮肤一个子文件夹，文件夹结构如下：</p><pre class=\"prettyprint\" style=\"margin-left: 2em; border-left-width: 3px; border-left-style: solid; border-left-color: rgb(204, 204, 204); padding: 0px 1em; word-break: break-word; word-wrap: break-word; white-space: pre-line; color: rgb(0, 0, 0); font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><span class=\"pln\" style=\"color:#000000;\">xheditor_skin\r\n&nbsp; </span><span class=\"pun\" style=\"color:#666600;\">└─</span><span class=\"kwd\" style=\"color:#000088;\">default</span><span class=\"pln\" style=\"color:#000000;\">\r\n&nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">├─</span><span class=\"pln\" style=\"color:#000000;\">ui</span><span class=\"pun\" style=\"color:#666600;\">.</span><span class=\"pln\" style=\"color:#000000;\">css\r\n&nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">├─</span><span class=\"pln\" style=\"color:#000000;\">iframe</span><span class=\"pun\" style=\"color:#666600;\">.</span><span class=\"pln\" style=\"color:#000000;\">css\r\n&nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">└─</span><span class=\"pln\" style=\"color:#000000;\">img\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">├─</span><span class=\"pln\" style=\"color:#000000;\">icons</span><span class=\"pun\" style=\"color:#666600;\">.</span><span class=\"pln\" style=\"color:#000000;\">gif\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">├─...</span><span class=\"pln\" style=\"color:#000000;\">\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><span class=\"pun\" style=\"color:#666600;\">└─</span><span class=\"pln\" style=\"color:#000000;\">loading</span><span class=\"pun\" style=\"color:#666600;\">.</span><span class=\"pln\" style=\"color:#000000;\">gif</span></pre><ul style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><li>编辑器按钮、面板、模式窗口等样式全部统一存储在ui.css文件中</li><li>编辑区域的样式存储在iframe.css文件中</li><li>编辑器内核用到的图片及css文件中用到的所有图片统一存储在img文件夹中</li></ul><h3 style=\"margin: 0px; font-size: 13px; color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">ui.css文件简单解析</h3><p style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">xheLayout：编辑器table样式；xheTool：工具按钮所在区域的样式；xheButton：按钮样式；xhePanel：操作面板的样式；xheMenu：菜单样式；xheEmot：表情样式；xheColor：颜色选择器的样式；xheDialog：面板上的对话框样式；xheModal：模式窗口样式；</p><p style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">xhEditor皮肤结构相对非常简单，有一定的HTML和CSS设计基础即可完成设计工作。</p><p style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">若希望xhEditor开发团队为您定制特殊的功能、皮肤和插件，请参阅<a href=\"http://xheditor.com/service\" style=\"color: rgb(0, 0, 255);\">我们提供的商业服务</a>页面。</p>');
INSERT INTO `templi_news_data` VALUES ('5', 'Simple example:<br />&lt;?php<br />try {<br />&nbsp;&nbsp; $dbh = new PDO(\'mysql:host=localhost;dbname=test\', \'root\', \'passowd\');<br /><br />&nbsp;&nbsp; $smf = $dbh-&gt;prepare(&quot;INSERT INTO test (`numer`) VALUES (?)&quot;);<br />&nbsp; <br />&nbsp;&nbsp; $a = mt_rand(1, 100);<br />&nbsp;&nbsp; $smf-&gt;bindParam(1, $a, PDO::PARAM_INT);<br />&nbsp;&nbsp; $smf-&gt;execute();<br />&nbsp;&nbsp; print $dbh-&gt;lastInsertId().\'&lt;br /&gt;\';<br /><br />&nbsp;&nbsp; $a = mt_rand(1, 100);<br />&nbsp;&nbsp; $smf-&gt;bindParam(1, $a, PDO::PARAM_INT);<br />&nbsp;&nbsp; $smf-&gt;execute();<br />&nbsp;&nbsp; print $dbh-&gt;lastInsertId();<br /><br />&nbsp;&nbsp; $dbh = null;<br />} catch (PDOException $e) {<br />&nbsp;&nbsp; print &quot;Error!: &quot; . $e-&gt;getMessage() . &quot;&lt;br/&gt;&quot;;<br />&nbsp;&nbsp; die();<br />}<br />?&gt;');
